import appData from "../../api/appData";
// import usersData from "../../api/usersData";
import {SIGN_UP_USER} from "../action-types";
import axios from 'axios'
export const signUpUser = (formValues)=> async dispatch=>{

    const response = await axios.post(`https://noctem-a60b5.firebaseio.com/users/`,formValues);
    dispatch({
        type:SIGN_UP_USER,
        payload:response.data
    })
};
